import React from 'react';

import List from '../list/list.component';

const UniverseSelector = ( { displayedItems, onToggle }) => {

    return (
        <List 
            displayedItems={displayedItems}
            onToggle={onToggle}
            className={'universes'}
            headerName={'Universe'}
            style={{width: '80%',marginTop: '20px'}}
        />
    )
}

export default UniverseSelector;
